import React from "react";


function App() {
  const u= "https://tih-api.stb.gov.sg/content/v1/attractions/search?keyword=park&sortBy=name&sortOrder=asc&language=en&apikey=AALYYjcafVG4UE8jddwk7OeqnWAvgluD";

  const fetchAttractions = async(url) => {
    try{
      const response = await fetch(url);
      const attractions = response.json();
      console.log(attractions)
    } catch (err) {
      console.log(err.message)
    }
  }
  return (
    <div>
      <h2>GA SEI-33</h2>
      <button onClick = {fetchAttractions}>All Park Attractions</button>
    </div>
  );
}

export default App;
